COTEJEM A EXTERIORIDADE DA LISTA DOS DIABÓLICOS PSICOPATAS TRAIDORES DA PÁTRIA E INIMIGOS LETAIS DO PODER (POVO) “INFRA”:
Todos os anátemas Comunistas; Ditadores; Estupradores; Serial Killes; Nazistas; Terroristas cinturões bomba, Terroristas pilotos de Aeronave (P. ex: 11 de Setembro Aviões de Passageiros lançados contra as Torres Gêmeas) e Antisemitas e Agnósticos, TODOS, sem exceção, são Psychopaths, Traidores do Poder (Povo) Patriota incondicional, (indivíduos inflexíveis nos seus objetivos macabro, totalmente egoístas e desprovidos de qualquer tipo de sentimento e afeto natural, também despojado de diminuta comiseração humana - protótipos de desprezos e violações dos direitos dos outros. (O nome técnico é transtorno de personalidade anti-social); 
Toda a súcia supra apontada na lista, deve ser EXTIRPADOS “Extempore” (De imediato) - “Ex Radice” (Da raiz);

